<script>
function WhichButton(event)
{
document.getElementById("mousebuttonstate").innerHTML = event.button;
}
function changeCell(e) {
if (document.getElementById("mousebuttonstate").innerHTML == '0')
  {
  x=document.getElementById("clr1").value;
  document.getElementById(e).style.backgroundColor = x; 
  document.getElementById(e).innerHTML = x; 
  }
  else if (document.getElementById("mousebuttonstate").innerHTML == '1')
  {
  x=document.getElementById("clr2").value;
  document.getElementById(e).style.backgroundColor = x; 
  document.getElementById(e).innerHTML = x; 
  }
  else if (document.getElementById("mousebuttonstate").innerHTML == '2')
  {
  x=document.getElementById("clr3").value;
  document.getElementById(e).style.backgroundColor = x; 
  document.getElementById(e).innerHTML = x; 
  }
  else
  {
  }

}
</script>
